description:
A woman facing incredible odds to ensure justice is done.

The movie follows the true story of a woman whose husband, Bob, is mysteriously murdered while trying to quell a wild teenage house party on New Year's Eve. Searching for answers about her husband's death, Katy faces a shroud of secrecy from the teens and their protective parents as they attempt to prevent her from finding out the truth...

